//import logo from './images/logo.svg';
import search from './images/search_icon.svg';
import Menu from './images/Menu.svg';
import Einstellung from './images/Einstellungen.png';
import Info from './images/Info.png';
import stud from './images/shortcut-stud.png';
import team from './images/shortcut-teams.png';
import ITLogo from './images/IT-Designer.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">    
        <img src={Menu} className="Menu" alt="menu" />  
        <img src={Info} className="Info" alt="info" />

        <img src={Einstellung} className="Einstellung" alt="settings" />
      </header>
      <div className="greeting-text">
         <b>Willkommen Max Mustermann</b>
      </div>
      <div className="search-bar">
         <img src={search} className="search-icon" alt="logo" />
      </div>
      <div className="box-field">
        <div className="box1">
          <img src={stud} className="Student" alt="student" />
          <a href="#students">Studenten</a>
        </div>
        <div className="box2">
          <img src={team} className="Team" alt="team" />
          <a href="#teams">Teams</a>
        </div>
        <div className="box3">
          <a href="https://it-designers-gruppe.de/">
            <img src={ITLogo} className="Logo" alt="logo" />
          Website</a>
        </div>
      </div>
    </div>

  );
}

export default App;
